import React from "react";

const ChineseCheckerBoard = () => {
    const drawPiece = (x: number, y: number, color: string) => {
        const style = {
            position: "absolute",
            top: `${y * 50}px`,
            left: `${x * 50}px`,
            width: "40px",
            height: "40px",
            borderRadius: "50%",
            backgroundColor: color,
        };

        return <div style={style}/>;
    };

    return (
        <div style={{ position: "relative", width: "450px", height: "450px", backgroundColor: "#f5f5f5" }}>
            {/* Draw pieces at specific coordinates */}
            {drawPiece(2, 3, "#ff6b6b")} {/* Red piece at (2, 3) */}
            {drawPiece(5, 6, "#6b88ff")} {/* Blue piece at (5, 6) */}
            {/* Add more drawPiece calls for other pieces */}
        </div>
    );
};

export default ChineseCheckerBoard;
